import { Container, Fab, makeStyles, Modal, TextField, Tooltip } from "@material-ui/core";

import AddIcon from "@material-ui/icons/Add";
import { useState } from "react";

const useStyles = makeStyles((theme) => ({
  fab: {
    position: "fixed",
    bottom: 20,
    right: 20,
  },
  container: {
    width: "500px",
    height: "550px",
    backgroundColor: "white",
    position: "absolute",
    top: 0,
    bottom: 0,
    left: 0,
    right: 0,
    margin: "auto",
    [theme.breakpoints.down("sm")]:{
      width: "100vw",
      height: "80vh",
    },
  },
}));
function Add() {
  const classes = useStyles();
  const [open, setOpen] = useState(false);
  return (
    <>
      <Tooltip title="Add" aria-label="add" onClick={() => setOpen(true)}>
        <Fab color="primary" className={classes.fab}>
          <AddIcon />
        </Fab>
      </Tooltip>
      <Modal open={open} onClose={()=> setOpen(false)}>
        <Container className={classes.container}><form className={classes.form} autoComplete="off">
         <div className={classes.item}>
           <TextField  id="standard-basic" label="title" size="small" style={{width:"100%"}}>

           </TextField>
           </div> </form></Container>
      </Modal>
    </>
  );
}

export default Add;
